import React from "react";
import Navbar from "../components/Navbar";
import Content from "../components/Content";

import { Route, Routes } from "react-router-dom";

const App = () => {
    return (
        <Routes>
            <Route path="/"
                element={<Content/>}/>
            <Route path="/cat"
                element={<Navbar/>}/>
        </Routes>
    )
}

export default App;
